      body: "This release is a feature release which includes package support for
        Red Hat\r\nEnterprise Linux 9 and compatible OSes, experimental support for
        multiple\r\nremotes, and some command-line helpers for `git lfs push`.\r\n\r\nIn
        this release, we no longer include vendored versions of our dependencies in\r\nthe
        repository or the tarballs.  These were a source of noise and bloat, and\r\nusers
        can easily download the required dependencies with Go itself.  Users who\r\nneed
        to continue to vendor the dependencies can use the `make vendor` target.\r\n\r\nIn
        addition, we've also switched the documentation to AsciiDoc from\r\nronn-flavoured
        Markdown and included the FAQ in the repository.  This means that\r\nthe manual
        pages now render properly in the GitHub web interface and it's also\r\nmuch
        easier to create additional formats, such as PDF, by leveraging the ability\r\nof
        Asciidoctor to convert to DocBook.\r\n\r\nIt should also be noted that `git
        lfs migrate import --everything` now processes\r\nall refs that aren't special
        to Git instead of just branches and tags.  This is\r\nwhat it was documented
        to do, but didn't, so we've fixed it.\r\n\r\nFinally, please note that future
        releases may be done by a different member of\r\nthe core team than many of
        the past releases, and thus may be signed by a\r\ndifferent OpenPGP key.  Please
        follow [the steps in the README to download all\r\nof the keys for the core\r\nteam](https://github.com/git-lfs/git-lfs#verifying-releases)
        to verify releases\r\nsuccessfully in the future.\r\n\r\nWe would like to
        extend a special thanks to the following open-source\r\ncontributors:\r\n\r\n*
        @dhiwakarK for fixing a broken link\r\n* @dscho for improving our installer\r\n*
        @Leo1690 for speeding things up with sparse checkout\r\n* @pratap043 for proposing
        an extension to locking\r\n* @rcoup for fixing our Makefile and adding scripting
        features to `git lfs push`\r\n* @srohmen for adding support for alternative
        remotes\r\n* @WhatTheFuzz for improving our error messages\r\n* @wuhaochen
        for fixing a long-standing bug with `git lfs migrate import`\r\n\r\n### Features\r\n\r\n*
        Add the FAQ in the repository #5167 (@bk2204)\r\n* Add support for Rocky Linux
        9 #5144 (@bk2204)\r\n* push: add ability to read refs/oids from stdin #5086
        (@rcoup)\r\n* Allow alternative remotes to be handled by LFS #5066 (@srohmen)\r\n*
        Switch documentation to AsciiDoc #5054 (@bk2204)\r\n\r\n### Bugs\r\n\r\n*
        Handle macro attribute references with unspecified flag #5168 (@chrisd8088)\r\n*
        Fixed broken link for git-lfs-migrate #5153 (@dhiwakarK)\r\n* ssh: disable
        concurrent transfers if no multiplexing #5136 (@bk2204)\r\n* Fix setting commit
        & vendor variables via make #5141 (@rcoup)\r\n* ssh: don't leak resources
        when falling back to legacy protocol #5137 (@bk2204)\r\n* Bump gitobj to v2.1.1
        #5130 (@bk2204)\r\n* tools: don't match MINGW as Cygwin #5106 (@bk2204)\r\n*
        installer: handle `BashOnly` Git for Windows gracefully #5048 (@dscho)\r\n*
        Change git-lfs migrate import --everything to migrate everything except for
        special git refs #5045 (@wuhaochen)\r\n\r\n### Misc\r\n\r\n* Use --sparse
        parameter for ls-files for performance optimization #5187 (@Leo1690)\r\n*
        Add information to ambiguous error message. #5172 (@WhatTheFuzz)\r\n* Distro
        update for v3.3.0 #5169 (@bk2204)\r\n* docs/man: clarify Git LFS setup instructions
        #5166 (@larsxschneider)\r\n* Update more stale comments relating to object
        scanning #5164 (@chrisd8088)\r\n* Update stale comments relating to object
        scanning and uploading #5163 (@chrisd8088)\r\n* script/cibuild: exclude icons
        from whitespace check #5142 (@bk2204)\r\n* Update to Go version 1.19 #5126
        (@chrisd8088)\r\n* Drop vendoring #4903 (@bk2204)\r\n* Adding locking_notes.md
        #5079 (@pratap043)\r\n* t: set init.defaultBranch #5082 (@bk2204)\r\n* go.mod:
        require gopkg.in/yaml.v3 v3.0.1 #5033 (@bk2204)\r\n* script/upload: improve
        readability of asset verification #5032 (@bk2204)\r\n## Packages\r\n\r\nUp
        to date packages are available on [PackageCloud](https://packagecloud.io/github/git-lfs)
        and [Homebrew](http://brew.sh/).\r\n\r\n[RPM RHEL 7/CentOS 7](https://packagecloud.io/github/git-lfs/packages/el/7/git-lfs-3.3.0-1.el7.x86_64.rpm/download)\r\n[RPM
        RHEL 8/Rocky Linux 8](https://packagecloud.io/github/git-lfs/packages/el/8/git-lfs-3.3.0-1.el8.x86_64.rpm/download)\r\n[RPM
        RHEL 9/Rocky Linux 9](https://packagecloud.io/github/git-lfs/packages/el/9/git-lfs-3.3.0-1.el9.x86_64.rpm/download)\r\n[Debian
        10](https://packagecloud.io/github/git-lfs/packages/debian/buster/git-lfs_3.3.0_amd64.deb/download)\r\n[Debian
        11](https://packagecloud.io/github/git-lfs/packages/debian/bullseye/git-lfs_3.3.0_amd64.deb/download)\r\n\r\n##
        SHA-256 hashes:\r\n**git-lfs-darwin-amd64-v3.3.0.zip**\r\n22e330e37fb3a0383c98aa98d3c443f401bfe97b369d4b5e2f4d2d2859fdd0b2\r\n\r\n**git-lfs-darwin-arm64-v3.3.0.zip**\r\nd9cc8219e04eea6e660c11f1119074575250ac661bde0a299e37e35d89cba365\r\n\r\n**git-lfs-freebsd-386-v3.3.0.tar.gz**\r\n9e2cc6c99b648b324497b4dab40f68d01feb5823111bff98c79e6a1de53a0222\r\n\r\n**git-lfs-freebsd-amd64-v3.3.0.tar.gz**\r\nb29d0c79eda865eccc5f7dd13385ce32215de2487f04186ed3a1ae7dce4a42dc\r\n\r\n**git-lfs-linux-386-v3.3.0.tar.gz**\r\n14415ebafc3ace60f178cd69d4f2e0ed42dbbf32cb2aba80e46ec3c8f7c1401f\r\n\r\n**git-lfs-linux-amd64-v3.3.0.tar.gz**\r\n6a4e6bd7d06d5c024bc70c8ee8c9da143ffc37d2646e252a17a6126d30cdebc1\r\n\r\n**git-lfs-linux-arm-v3.3.0.tar.gz**\r\ndf8b24cf7ff6a2f105dd1a3d0a4990c53980272ea94da67d854921e21bc5444c\r\n\r\n**git-lfs-linux-arm64-v3.3.0.tar.gz**\r\ne97c477981a9b6a40026cadc1bf005541d973fc32df2de2f398643b15df6b5c6\r\n\r\n**git-lfs-linux-ppc64le-v3.3.0.tar.gz**\r\n32a22e5496a8c8028e5c8193fd5941a0acae800d65296f09901237f1e2146a79\r\n\r\n**git-lfs-linux-s390x-v3.3.0.tar.gz**\r\n266e0efd3c790003bbbf31156d471e832b9fb27dda6968e56aca2a669d01e245\r\n\r\n**git-lfs-v3.3.0.tar.gz**\r\n964c200bb7dcd6da44cbf0cfa88575f7e48d26925f8ec86d634d3f83306a0920\r\n\r\n**git-lfs-windows-386-v3.3.0.zip**\r\n81fd4b01719e1e0ccf347596293f19a07fba8573c6aee1e1521b2932d9b6179d\r\n\r\n**git-lfs-windows-amd64-v3.3.0.zip**\r\n1df5874f22c35c679159f0aaf9e24333051f52768eade0204d22200b79141743\r\n\r\n**git-lfs-windows-arm64-v3.3.0.zip**\r\ncf16b91ba10009b98bd641897609d9fd6994941705435aac60d12938322fbdbe\r\n\r\n**git-lfs-windows-v3.3.0.exe**\r\n81b28b59a100ab5023e62e7bc99e25c33fadf2e106a8c3a36f535b05e52dd76b\r\n\r\n**hashes.asc**\r\n50ca3a33d866ef72623b36162317d2547a37ae18cd03a10507c9e6e476982ac0\r\n\r\n**sha256sums.asc**\r\ne1c0b69c674d14d1936baf41f4f21d1245d73acf56d1f2965532ea4e09d74161\r\n"
