          body: "## What's Changed\r\n* fix(workflows): fix docker image publish flow
            by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2580\r\n*
            fix #2537: `if` with identical `then` and `else` branches by @chavacava
            in https://github.com/runatlantis/atlantis/pull/2545\r\n* fix: Silence
            allow list errors works again by @zer0beat in https://github.com/runatlantis/atlantis/pull/2535\r\n*
            build(deps): bump github.com/go-redis/redis/v9 from 9.0.0-beta.2 to 9.0.0-beta.3
            by @dependabot in https://github.com/runatlantis/atlantis/pull/2578\r\n*
            build(deps): bump github.com/hashicorp/hcl/v2 from 2.6.0 to 2.14.1 by
            @dependabot in https://github.com/runatlantis/atlantis/pull/2579\r\n*
            Add basic documentation for the prometheus exporter by @marcusramberg
            in https://github.com/runatlantis/atlantis/pull/2582\r\n* docs: typo ATLANTIS_GH_ALLOW_MERGEABLE_BYPASS_APPLY
            by @nitrocode in https://github.com/runatlantis/atlantis/pull/2583\r\n*
            hadolint: base: pin all dependencies by @nitrocode in https://github.com/runatlantis/atlantis/pull/2587\r\n*
            Bump atlantis-base:2022.10.14 by @nitrocode in https://github.com/runatlantis/atlantis/pull/2589\r\n*
            build(deps): bump github.com/go-redis/redis/v9 from 9.0.0-beta.3 to 9.0.0-rc.1
            by @dependabot in https://github.com/runatlantis/atlantis/pull/2590\r\n*
            build(deps): bump github.com/moby/moby from 20.10.18+incompatible to 20.10.19+incompatible
            by @dependabot in https://github.com/runatlantis/atlantis/pull/2591\r\n*
            deps: bump terraform to 1.3.3 and docs update by @nitrocode in https://github.com/runatlantis/atlantis/pull/2614\r\n*
            deps: bump conftest to 0.35.0 by @nitrocode in https://github.com/runatlantis/atlantis/pull/2615\r\n*
            fix: typo in log message when running parallel plans by @forestoden in
