          body: "## What's Changed\r\n* feat: auto-plan projects when modules change
            by @iamnoah in https://github.com/runatlantis/atlantis/pull/2507\r\n*
            deps: update to use tf 1.3.6 by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2744\r\n*
            feat: support atlantis.yaml without defined projects by @csainty in https://github.com/runatlantis/atlantis/pull/2300\r\n*
            build(deps): bump decode-uri-component from 0.2.0 to 0.2.2 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2748\r\n* Use GitHub Actions
            cache when building Docker images by @Tenzer in https://github.com/runatlantis/atlantis/pull/2737\r\n*
            Cache downloaded Go dependencies and Atlantis compilation in Docker by
            @Tenzer in https://github.com/runatlantis/atlantis/pull/2738\r\n* build(deps):
            bump golang.org/x/text from 0.4.0 to 0.5.0 by @dependabot in https://github.com/runatlantis/atlantis/pull/2751\r\n*
            build(deps): bump runatlantis/atlantis-base from 2022.11.24 to 2022.12.05
            by @dependabot in https://github.com/runatlantis/atlantis/pull/2750\r\n*
            build(deps): bump go.uber.org/zap from 1.23.0 to 1.24.0 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2752\r\n* build(deps):
            bump github.com/Masterminds/sprig/v3 from 3.2.2 to 3.2.3 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2753\r\n* build(deps):
            bump github.com/golang-jwt/jwt/v4 from 4.4.2 to 4.4.3 by @dependabot in
            https://github.com/runatlantis/atlantis/pull/2754\r\n* docs: add example
            how to customize the conftest command by @pokgak in https://github.com/runatlantis/atlantis/pull/2727\r\n*
            docs: Add a new Azure deployment method by @jakubigla in https://github.com/runatlantis/atlantis/pull/2741\r\n*
            docs: add docs to resolve `webhook: not_in_channel` error by @KivraChristoffer
            in https://github.com/runatlantis/atlantis/pull/2759\r\n* fix(gitlab_client):
            prevent duplicate pipelines in gitlab merge requests by @michelmzs in
            https://github.com/runatlantis/atlantis/pull/2745\r\n* feat: prevent planning
            and applying directories outside PR scope using `--restrict-file-list`
            by @Fabianoshz in https://github.com/runatlantis/atlantis/pull/2440\r\n*
            Enable or disable `repo_locking` per repo in `repos.yaml` and `atlantis.yaml`
            by @krrrr38 in https://github.com/runatlantis/atlantis/pull/2700\r\n*
            docker-base: alpine 3.17.0 by @nitrocode in https://github.com/runatlantis/atlantis/pull/2768\r\n*
            Bump atlantis-base to 2022-12-11 by @nitrocode in https://github.com/runatlantis/atlantis/pull/2769\r\n*
            docs: terraform version usage after allowing additional `required_version`
            specifiers by @grimm26 in https://github.com/runatlantis/atlantis/pull/2760\r\n*
            Separate docker image types in matrix by @nitrocode in https://github.com/runatlantis/atlantis/pull/2770\r\n*
            docker-base: alpine: pin git=2.38.2-r0 by @nitrocode in https://github.com/runatlantis/atlantis/pull/2773\r\n*
            Use correct image suffix for alpine/debian by @nitrocode in https://github.com/runatlantis/atlantis/pull/2774\r\n*
            Use correct image suffix for alpine/debian (again) by @nitrocode in https://github.com/runatlantis/atlantis/pull/2775\r\n*
            Use atlantis-base:2022.12.12 by @nitrocode in https://github.com/runatlantis/atlantis/pull/2772\r\n*
            build(deps): bump golang.org/x/term from 0.2.0 to 0.3.0 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2778\r\n* build(deps):
            bump github.com/go-test/deep from 1.0.8 to 1.1.0 by @dependabot in https://github.com/runatlantis/atlantis/pull/2779\r\n*
