            in https://github.com/runatlantis/atlantis/pull/2777\r\n* docs(ha): wording
            update when using redis by @JonGilmore in https://github.com/runatlantis/atlantis/pull/2771\r\n*
            docs(changelog): explicitly list the tf versions <1.x removal in the CHANGELOG.md
            by @NitriKx in https://github.com/runatlantis/atlantis/pull/2780\r\n*
            Add dependabot for e2e and base container by @nitrocode in https://github.com/runatlantis/atlantis/pull/2788\r\n*
            bugfix: add missing build-args to dev image by @nitrocode in https://github.com/runatlantis/atlantis/pull/2787\r\n*
            build(deps): bump golang from 1.19.3 to 1.19.4 in /testing by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2789\r\n* build(deps):
