          body: "This release is a feature release which includes support for machine-readable\r\nformats
            for a couple more commands, plus the ability to automatically merge\r\nLFS-based
            text files from the command-line.  It's likely that the merge driver\r\nwill
            see future improvements, but if you have feedback on the design, please
            use\r\nthe discussions feature.\r\n\r\nNote that our binary release archives
            no longer unpack into the current\r\ndirectory, and now contain a top-level
            directory just like the source archives\r\ndo.\r\n\r\nWe would like to
            extend a special thanks to the following open-source\r\ncontributors:\r\n\r\n*
            @bbodenmiller for fixing the formatting in our manual pages\r\n* @breyed
            for fixing a typo in our manual pages\r\n* @btoll for improving our README\r\n*
            @rcoup for fixing our Accept header syntax\r\n* @vtbassmatt for documenting
            our deprecation of NTLM\r\n\r\n### Features\r\n\r\n* ls-files: add a --json
            option #5007 (@bk2204)\r\n* Add --json output for git lfs track #5006
            (@bk2204)\r\n* Add a merge driver #4970 (@bk2204)\r\n* lfs: don't write
            hooks when they haven't changed #4935 (@bk2204)\r\n* Tarballs, not tarbombs
            #4980 (@bk2204)\r\n\r\n### Bugs\r\n\r\n* Apply several Makefile fixes
            for Windows #5016 (@bk2204)\r\n* git: don't panic on pkt-line without
            equals #4982 (@bk2204)\r\n* lfshttp: fix invalid Accept header syntax
            #4996 (@rcoup)\r\n* Grammar fix #4981 (@breyed)\r\n* Use `gitignore`-style
            path matching for additional commands #4951 (@chrisd8088)\r\n* Avoid pruning
            when identical files both match and do not match `lfs.fetchexclude` #4973
            (@chrisd8088)\r\n* Apply `lfs.fetchexclude` filter to previous commits
            when pruning #4968 (@chrisd8088)\r\n* Update and correct several error
            message strings #4943 (@chrisd8088)\r\n* script/upload: correct RHEL 8
            package repo #4936 (@bk2204)\r\n* lfs: add old hook content to the list
            of old hooks #4878 (@bk2204)\r\n* .github/workflows: install packagecloud
            gem #4873 (@bk2204)\r\n\r\n### Misc\r\n\r\n* Update distros for packagecloud.io
            #5010 (@bk2204)\r\n* lfshttp: log the Negotiate error on failure #5000
            (@bk2204)\r\n* Build CI on Windows 2022 #4997 (@chrisd8088)\r\n* workflows:
            use ronn-ng #4992 (@bk2204)\r\n* Multiple hash support #4971 (@bk2204)\r\n*
            note deprecation of NTLM #4987 (@vtbassmatt)\r\n* Update to Go 1.18, drop
            older Go version support, and update modules and dependencies #4963 (@chrisd8088)\r\n*
            Update tests to check `prune` command excludes `lfs.fetchexclude` paths
            #4964 (@chrisd8088)\r\n* Add test to check `prune` command retains tagged
            unpushed objects #4962 (@chrisd8088)\r\n* Adjust test helpers and tests
            related to path filtering #4960 (@chrisd8088)\r\n* Include shell path
            in restricted `PATH` in credential helper path test #4959 (@chrisd8088)\r\n*
            Build test helper commands with `.exe` file extension on Windows #4954
            (@chrisd8088)\r\n* Update Windows signing certificate SHA hash in `Makefile`
            #4946 (@chrisd8088)\r\n* remove unused `Pipe[Media]Command()` functions
            #4942 (@chrisd8088)\r\n* Makefile: remove legacy trimpath code #4938 (@bk2204)\r\n*
            add Inno Setup check of Git install paths and remove old uninstaller checks
            #4925 (@chrisd8088)\r\n* note `git lfs push --all` only pushes local refs
            in man page #4898 (@chrisd8088)\r\n* Build man pages into per-section
            subdirectories #4890 (@chrisd8088)\r\n* Call out destructive command in
            README #4880 (@btoll)\r\n* Improve formatting #4863 (@bbodenmiller)\r\n*
            docs/howto: remind core team member to check Actions workflows #4868 (@bk2204)\r\n*
            .github: fix syntax error in release workflow #4866 (@bk2204)\r\n## Packages\r\n\r\nUp
            to date packages are available on [PackageCloud](https://packagecloud.io/github/git-lfs)
            and [Homebrew](http://brew.sh/).\r\n\r\n[RPM RHEL 7/CentOS 7](https://packagecloud.io/github/git-lfs/packages/el/7/git-lfs-3.2.0-1.el7.x86_64.rpm/download)\r\n[RPM
            RHEL 8/CentOS 8](https://packagecloud.io/github/git-lfs/packages/el/8/git-lfs-3.2.0-1.x86_64.rpm/download)\r\n[Debian
            9](https://packagecloud.io/github/git-lfs/packages/debian/stretch/git-lfs_3.2.0_amd64.deb/download)\r\n[Debian
            10](https://packagecloud.io/github/git-lfs/packages/debian/buster/git-lfs_3.2.0_amd64.deb/download)\r\n[Debian
            11](https://packagecloud.io/github/git-lfs/packages/debian/bullseye/git-lfs_3.2.0_amd64.deb/download)\r\n\r\n##
            SHA-256 hashes:\r\n**git-lfs-darwin-amd64-v3.2.0.zip**\r\nc48c6a0c21d6fd286e54154fedae109bca9886caf520336cbdbbde1f209d8aff\r\n\r\n**git-lfs-darwin-arm64-v3.2.0.zip**\r\nbf0fbe944e2543cacca74749476ff3671dff178b5853489c1ca92a2d1b04118e\r\n\r\n**git-lfs-freebsd-386-v3.2.0.tar.gz**\r\n66ca0f662eeaefa2c191577f54d7d2797063f7f4e44c9130cf7186d8372df595\r\n\r\n**git-lfs-freebsd-amd64-v3.2.0.tar.gz**\r\n776b41b526f1c879b2a106780c735f58c85b79bf97a835140d4c1aefc8c935b6\r\n\r\n**git-lfs-linux-386-v3.2.0.tar.gz**\r\n73895460f9b3e213d10fb23948680681ab3e5f92e2fb0a74eb7830f6227a244e\r\n\r\n**git-lfs-linux-amd64-v3.2.0.tar.gz**\r\nd6730b8036d9d99f872752489a331995930fec17b61c87c7af1945c65a482a50\r\n\r\n**git-lfs-linux-arm-v3.2.0.tar.gz**\r\n3273b189fea5a403a2b6ab469071326ae4d97cb298364aa25e3b7b0e80340bad\r\n\r\n**git-lfs-linux-arm64-v3.2.0.tar.gz**\r\n8186f0c0f69c30b55863d698e0a20cf79447a81df006b88221c2033d1e893638\r\n\r\n**git-lfs-linux-ppc64le-v3.2.0.tar.gz**\r\nff1eeaddde5d964d10ce607f039154fe033073f43b8ff5e7f4eb407293fe1be3\r\n\r\n**git-lfs-linux-s390x-v3.2.0.tar.gz**\r\n16556f0b2e1097a69e75a6e1bcabfa7bfd2e7ee9b02fe6e5414e1038a223ab97\r\n\r\n**git-lfs-v3.2.0.tar.gz**\r\nf8e6bbe043b97db8a5c16da7289e149a3fed9f4d4f11cffcc6e517c7870cd9e5\r\n\r\n**git-lfs-windows-386-v3.2.0.zip**\r\n68d525f70d9bdb1e9e64c3fe156c2164739ee4990a2fb37bd9f101d59cd43a61\r\n\r\n**git-lfs-windows-amd64-v3.2.0.zip**\r\nc2ee1f7b22d98f614cab94e1033052143f4dbf1207c09ce57e9390acc4bbf86e\r\n\r\n**git-lfs-windows-arm64-v3.2.0.zip**\r\ndda85631f931ea0d2edaf8ef922bed5cb2c60f83ac6d741c16159495e59a2ea4\r\n\r\n**git-lfs-windows-v3.2.0.exe**\r\nf45b3cc1f3b4d1941487f305a1db3730cc57f4cd9c199492ac3138188734238c\r\n\r\n**hashes.asc**\r\nbdf14b5b9bd8fc3da998578a16b6dd5340b62670ce03a4358186ae1a085b051c\r\n\r\n**sha256sums.asc**\r\n2281d58e4bda0274e2b2d578994de8d460b9d26122e1273f174f65c587b904db\r\n"
